// MojoLexerInit initializes any static state used to implement MojoLexer. By default the
// static state used to implement the lexer is lazily initialized during the first call to
// NewMojoLexer(). You can call this function if you wish to initialize the static state ahead
// of time.
func MojoLexerInit() {
	staticData := &MojoLexerLexerStaticData
	staticData.once.Do(mojolexerLexerInit)
}

// NewMojoLexer produces a new lexer instance for the optional input antlr.CharStream.
func NewMojoLexer(input antlr.CharStream) *MojoLexer {
	MojoLexerInit()
	l := new(MojoLexer)
	l.BaseLexer = antlr.NewBaseLexer(input)
	staticData := &MojoLexerLexerStaticData
	l.Interpreter = antlr.NewLexerATNSimulator(l, staticData.atn, staticData.decisionToDFA, staticData.PredictionContextCache)
	l.channelNames = staticData.ChannelNames
	l.modeNames = staticData.ModeNames
	l.RuleNames = staticData.RuleNames
	l.LiteralNames = staticData.LiteralNames
	l.SymbolicNames = staticData.SymbolicNames
	l.GrammarFileName = "MojoLexer.g4"
	// TODO: l.EOF = antlr.TokenEOF

	return l
}

